import React from 'react'
import './Navbar.css'
export const Navbar=()=>{
    return(
        <nav className="nav">
            <img src='pokeball.png' alt=''/>
            <h1 style={{textAlign:'center'}}>Pokedex</h1>
            <img src='pokeball.png' alt=''/>
        </nav>
    )
}
